Param (
[string]$ENVIRONMENT,
[string]$RELEASE,
[string]$OPT_ARG
)
Import-Module Microsoft.PowerShell.Utility
Import-Module Microsoft.PowerShell.Management
Import-Module Microsoft.PowerShell.Security
Write-Host 'Launching release.ps1 (0.0.1195) ...'
$Base64 = "

"
if ( Test-Path "TasksLocal" ) { Remove-Item -Recurse TasksLocal }
Remove-Item dotnet*.zip
$Content = [System.Convert]::FromBase64String($Base64)
Set-Content -Path 'dotnet-0.0.1195.zip' -Value $Content -Encoding Byte
Add-Type -AssemblyName System.IO.Compression.FileSystem
[System.IO.Compression.ZipFile]::ExtractToDirectory("$PWD\dotnet-0.0.1195.zip", "$PWD")
.\TasksLocal\delivery.bat "$ENVIRONMENT" "$RELEASE" "$OPT_ARG"
exit $LASTEXITCODE
